import React, { Component } from "react";
import "./App.css";

class App extends Component {
  getWeather= async(e)=>{
    e.preventDefault();
    const city = e.target.elements.city.value;
    const country = e.target.elements.country.value;
    fetch(`http://api.openweathermap.org/data/2.5/weather?q=${city},${country}&appid=ea695ae24c843680f5719fc33376a096&units=metric`).then(response=>response.json()).then(response=>console.log(response));
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h2>Weather App</h2>
        </header>
        <form onSubmit={this.getWeather}>
          <label>City</label>
          <input type="text" name="city" placeholder="Enter City"/>
          <label>Country</label>
          <input type="text" name="city" placeholder="Enter Country"/>
          <button>Get Weather</button>
        </form>
      </div>
    );
  }
}

export default App;
